import { Client } from 'pg';
import dotenv from 'dotenv';
dotenv.config()


const DATABASE_URL = process.env.DATABASE_URL
export const client = new Client({
    connectionString: DATABASE_URL,
    ssl: {
        
        
        rejectUnauthorized: false
    }
});

client.connect();
export async function insertNewUser(userData: any) {
    const sql = `INSERT INTO users(email,password,phone_number,city,street) VALUES($1, $2 ,$3 ,$4, $5)`
    await client.query(sql, [userData.email,userData.password,userData.phone_number,userData.city,userData.street]);
}


